import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-eventos',
  templateUrl: './eventos.component.html',
  styleUrls: ['./eventos.component.scss']
})
export class EventosComponent implements OnInit {

  public eventos: any = [
    {
      Tema: 'Angular',
      Local: 'Curitiba-PR'
    },
    {
      Tema: '.Net',
      Local: 'São Paulo-SP'
    },
    {
      Tema: 'HTML5',
      Local: 'Rio de Janeiro-RJ'
    }
  ]

  constructor() { }

  ngOnInit() {
  }

}
